## Welcome {.unnumbered}

This document provides a first insight on the level of 2021 cost-effectiveness performance both for the Pan-European system and for individual ANSPs before the official release of the ACE 2021 benchmarking report.

This document is also available for download as a
[PDF version](https://www.eurocontrol.int/ACE/HighLevelSummary-Reports/HighLevelSummaryReport2021.pdf){target="_blank"}.


### IMPORTANT NOTICE {.unnumbered}

[Data contained in this document are preliminary and subject to changes before the publication of the final ACE 2021 benchmarking report in May 2023.]{style="color: red;"}
